import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <Auth0Provider
    domain="dev-vgdwcqt11qrihuga.us.auth0.com"
    clientId="NAZew8HuSr2OElLeBFLKBQmicjFmkmEf"
    authorizationParams={{
      redirect_uri: window.location.origin
    }}
  >
    <App />
    </Auth0Provider>
  </React.StrictMode>,
  document.getElementById('root')
);
